function Photography() {
  return (
    <div className="Photography">
      Photography!<br/>
      <img src="../../assets/Photography/Seoul" alt=""/>

      <div className="grid">
        <div className="grid-item"><img src="../../assets/Photography/Seoul" alt=""/></div>
      </div>

    </div>
  )
}

export default Photography
